import React, { useEffect, useState } from 'react';


const PointLeaders = (data) => {
    const instance = data.props;

    const [ first, setFirst ] = useState(null);
    const [ second, setSecond ] = useState(null);
    const [ third, setThird ] = useState(null);

    const home = instance.vls.pstsg;
    const away = instance.hls.pstsg;

    const getStars = () => {

        for(var x=0; x<home.length; x++) {
            if(home.pts !== null) {
                if(home[x].pts > first.pts) {
                    setThird(second);
                    setSecond(first);
                    setFirst(home[x]);
                } else if(home[x].pts === first.pts) {
                    setThird(second);
                    setSecond(home[x]);
                } else if(home[x].pts > second.pts) {
                    setThird(second);
                    setSecond(home[x]);
                } else if(home[x].pts > second.pts) {
                    setThird(home[x]);
                }
            }
        }

        for(var x=0; x<away.length; x++) {
            if(away[x].pts > first.pts) {
                console.log('new first')
                setThird(second);
                setSecond(first);
                setFirst(away[x]);
            }
        }

        console.log('first');
        console.log(first);
        console.log('second');
        console.log(second);
        console.log('third');
        console.log(third);
    }

    useEffect(()=>{
        getStars();
    }, [])

    return (
        <div className="point-leaders">
            <h1>Hello</h1>
        </div>
    );
}

export default PointLeaders;
